        private static string getTerm(string[] t) { return t[rand.Next(t.Length)]; }

        const int chanceOfSeq = 4;
        public static string getGameName()
        {
            if (rand.Next(100) == 0) return getTerm(spc);
            string ret = getTerm(adjEd) + " " + getTerm(noun) + " " + getTerm(nounEd);
            int opt = rand.Next(chanceOfSeq);
            switch (opt)
            {
                case 0:
                    break;
                case 1:
                    ret += " " + getTerm(rom) + ": " + getTerm(seq) + " of " + ret;
                    break;
                default:
                    if (rand.Next(2) == 0)
                        ret += ": " + getTerm(sub1);
                    else
                        ret += " " + getTerm(sub2);
                    break;
            }

            return ret;
        }
